insert  into `location`(`id`,`name`,`description`,`depth`,`is_free`,`price`,`location_flow_id`,`location_fundus_id`,`location_relief_id`,`location_type_id`,`location_scope_id`,`address_id`,`created_by`,`updated_by`,`slug`,`created_at`,`updated_at`,`latitude`,`longitude`,`version`) values (682,'База Золотые пески','База Золотые пески расположена на правом берегу Волги в Енотаевском районе Астраханской области, близ села Замьяны. НА 1321 км.  ФЕДЕРАЛЬНОЙ ТРАССЫ М-6. Трофейная ловля - сома, сазана, жереха, судака, щуки, окуня, леща, линя и буфало.',NULL,0,'<p><strong>Жилье</strong></p>\r\n<p>1200 руб. с человека в сутки на основном месте.</p>\r\n<p>700 руб с человека в сутки на дополнительном месте.</p>\r\n<p><strong>Лодки и моторы</strong> ( цена при предварительной оплате / цена при оплате на базе) за световой день</p>\r\n<p>Лодка КАЗАНКА 5М4 с эхолотом и мотором Меркурий 40 1500/2000руб.</p>\r\n<p>Пластиковая лодка SAVA с мотором Меркурий 15 800/ 1000руб.</p>\r\n<p>Лодка Крым и другие с мотором Меркурий 15 800/ 1000руб.</p>\r\n<p>Лодка без мотора 300/ 400руб. Цены на лодки и моторы указаны без учета ГСМ и услуг егеря.</p>\r\n<p>Цена 1литра ГСМ (бензин с маслом) 30-35руб.&nbsp;</p>\r\n<p><strong>Еда</strong></p>\r\n<p>На территории Базы работает кафе, где Вас ждет теплая, уютная обстановка, улыбки персонала и большой ассортимент вкусных и любимых блюд: горячие и холодные закуски, первые и вторые блюда, десерты, выпечка, мороженое.Средняя цена за полноценное 3-х разовое питание 650-730 рублей . В т.ч.завтрак - ок.140руб, обед - ок.300руб., ужин ок.270руб.</p>',NULL,NULL,NULL,1,5,644,1,1,'154','2011-06-08 01:55:10','2011-06-08 02:14:00',46.823242071399996,47.608944828799999,4);
